import React from 'react';
import Carousel from 'react-material-ui-carousel';
import { Paper, Button } from '@material-ui/core';
import { projects } from '../../data';
import { styled } from '@material-ui/core/styles';

export const MyCar = styled(Carousel)({
    backgroundColor: "#2B2F32",
    height: "80vh",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    color: "#51595F",
    borderRadius: "5px"
});
export const MyPaper = styled(Paper)({
    // display: "flex",
    // flexDirection: "column",
    height: "70%",
    width: "75%",
    backgroundColor: "#F4F4F4",
});



const Pros = ({ isOpen }) => {

    const card = (props) => {
        return (
            <MyPaper style={{ textAlign: "left", overflow: "hidden"}}>
                <h2>{props.name}</h2>
                <section style={{ display: 'flex', width: "100%", height: '55%', padding: '2rem 2rem', border: "black solid 2px" ,backgroundColor: "black"}}>
                    <img src={projects[0].photos[0]} style={{ width: "60%"}} />
                    <div className='column-photos' style={{ width: "40%", height: "15%", border: "solid black 2px"}} >
                        <img src={projects[0].photos[1]} className='images' style={{ width: '80%', height: '50%', borderRadius: '.3rem' }} />
                        <img src={projects[0].photos[2]} className='images' style={{ width: '80%', height: '50%', borderRadius: '.3rem' }} />
                        <img src={projects[0].photos[3]} className='images' style={{ width: '80%', height: '50%', borderRadius: '.3rem' }} />
                    </div>
                </section>
                {/* <img style={{ width: "60%", height: "10%" }} src={projects[0].photos[0]} /> */}
                <p>{props.description}</p>
                <Button className="CheckButton">See website</Button>
                <Button className="CheckButton">See code</Button>
            </MyPaper>
        )
    }
    return (
        <>
            {isOpen ?
                <div syle={{ position: 'absolute', display: "flex", justifyContent: "center" }}>
                    <MyCar
                        autoPlay={false}
                        className="car"
                        animation="slide"
                        classes={{}}
                        next={(next, active) => console.log(`we left ${active}, and are now at ${next}`)}
                        prev={(prev, active) => console.log(`we left ${active}, and are now at ${prev}`)}
                    >
                        {projects.map(project => card(project))}
                    </MyCar>
                </div>
                :
                null
            }
        </>
    )
}

export default Pros
